define(['./filter'], function (filter) {

    /**
     * Remove all null/undefined items from array.
     */
    /**
     * Description
     * @method compact
     * @param {} arr
     * @return CallExpression
     */
    function compact(arr) {
        return filter(arr, function(val){
            return (val != null);
        });
    }

    return compact;
});
